import "./App.css";
import Header from "./Header/Header";
import Footer from "./footer";
import Home from "./Home";
import Card from "./Header/Card";



import Sport from "./sports";
import Cardpage from "./Header/Cardpage";




function App() {
  return (
    <div className="App">
    <Home />
  <Header />
  <br />
  <Card />
    <Cardpage/>
   
   
   

   
    
      <Sport/>
      <br/>
      <Footer/>
    </div>
  );
}

export default App;
